    private static final String PAHT = "/Users/liko/work/iquantex/code/pull_iquantex_git.sh";

    public static void main(String[] args) throws IOException {

        List<GitlabProject> gitlabProjectList = Arrays.stream(GITLAB_PROJECT_STRS)
                .map(GITLAB_PROJECT_STR -> JSON.parseArray(GITLAB_PROJECT_STR, GitlabProject.class))
                .flatMap(Collection::stream)
                .collect(Collectors.toList());

        File file = new File(PAHT);
        if (!file.exists()) {
            file.createNewFile();
        }

        try (BufferedWriter writer = new BufferedWriter(new FileWriter(file))) {
            writer.write("#!/bin/bash");
            writer.newLine();
            writer.write("git init");
            writer.newLine();

            gitlabProjectList.stream().forEach(gitlabProject -> {
                try {
                    writer.write("git submodule add -b master https://gitlab.iquantex.com" + gitlabProject.getRelative_path() + " " + gitlabProject.getRelative_path().substring(1));
                    writer.newLine();
                } catch (IOException e) {
                    e.printStackTrace();
                }
            });
        } catch (IOException e) {
            e.printStackTrace();
        }

    }
